import '../../App.css'
import React from 'react'
import CardItem from '../CardItem'
import {Link} from 'react-router-dom';
import { Button } from '../Button';
import backgroundVideo from '../../videos/video-3.mp4'
import { TextField,
        FormControl, 
        Grid, 
        Paper,
        InputLabel, 
        FormGroup } from '@material-ui/core';
// import InputLabel from '@mui/material/InputLabel';

export default function SignUpFormCreator(){
    const [password, setPassword] = setState("");
    const [showPassword, setShowPassword] = set
    return (
        <Grid>
            <Paper elevation={10}>
                <FormControl>
                    <FormGroup>
                        {/* <InputLabel htmlFor="email">Email address</InputLabel> */}
                        <TextField id="name" label="Name" variant="filled" />
                    </FormGroup>
                    <FormGroup>
                        {/* <InputLabel htmlFor="email">Email address</InputLabel> */}
                        <TextField id="surname" label="Surname" variant="filled" />
                    </FormGroup>
                    <FormGroup>
                        {/* <InputLabel htmlFor="email">Email address</InputLabel> */}
                        <TextField id="email" label="Email" variant="filled" />
                    </FormGroup>
                    <FormGroup>
                        {/* <InputLabel htmlFor="password">Password</InputLabel> */}
                        <TextField id="password" label="Password" variant="filled" />
                    </FormGroup>
                    <FormControl sx={{ m: 1, width: '25ch' }} variant="outlined">
                        <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
                        <OutlinedInput
                            id="outlined-adornment-password"
                            type={values.showPassword ? 'text' : 'password'}
                            value={values.password}
                            onChange={handleChange('password')}
                            endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                aria-label="toggle password visibility"
                                onClick={handleClickShowPassword}
                                onMouseDown={handleMouseDownPassword}
                                edge="end"
                                >
                                {values.showPassword ? <VisibilityOff /> : <Visibility />}
                                </IconButton>
                            </InputAdornment>
                            }
                            label="Password"
                        />
                        </FormControl>
                </FormControl>
            </Paper>
        </Grid>
    );
}
